import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

let city = {
    name: "Madrid",
    country : "Spain"
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
   <ul>
       <li>Hot Dogs {city.name}</li>
       <li>Hamburgers {city.country}</li>
       <li>Pizza</li>
       <li>Sushi</li>

   </ul>
)
